window.HyperbolaDateFormatter=function(){var b="jan feb mar apr may jun jul aug sep oct nov dec".split(" ");return{write:function(c){var a=new Date;a.setTime(1E3*c);document.write(("0"+a.getHours()).slice(-2)+":"+("0"+a.getMinutes()).slice(-2)+" "+b[a.getMonth()]+" "+("0"+a.getDate()).slice(-2)+" "+a.getFullYear())}}}();
